import "./Nav.css";

export default function Nav() {
  return (
    <nav className="nav">
      <div className="logo">Lucy Nailed It</div>
      <ul className="nav-links">
        <li><a href="#about">About</a></li>
        <li><a href="#gallery">Gallery</a></li>
        <li><a href="#footer">Contact</a></li>
      </ul>
    </nav>
  );
}
